const NumberSelector=()=>{
    const arrNumber=[1,2,3,4,5,6];
    return(
        <div>
            {
                arrNumber.map((value,i)=>(
                    <div className="box" key={i}>{value}</div>
                ))
            }
           

        </div>
    );
};
export default NumberSelector;
